import React, { Component } from 'react'
import axios from 'axios'

 class Products extends Component {
    state={
        product : []
    }
    componentDidMount(){
        axios.get('/Api.json')
        .then((item)=>{
            this.setState(
                {
                    product : item.data.products
                }
            )
        })
    }
  render() {
   
    return (
      <div>
        {this.state.product.map((result)=>(
            <div>
                <img src={result.image}></img>
            </div>

        ))}

      </div>
    )
  }
}

export default Products
